/* Model update function */
void Intergration_TJA_update(void)
{
  /* Update for S-Function (RTICANMM_MAIN_CAN): '<S60>/sfcn' */
  /* Level2 S-Function Block: '<S60>/sfcn' (RTICANMM_MAIN_CAN) */
  {
    SimStruct *rts = Intergration_TJA_M->childSfunctions[1];
    sfcnUpdate(rts,0);
    if (ssGetErrorStatus(rts) != (NULL))
      return;
  }

  /* Update for ModelReference: '<Root>/VSI' */
  VSI_Update();

  /* Update for Delay: '<S306>/Delay' */
  Intergration_TJA_DW.icLoad = 0U;
  Intergration_TJA_DW.Delay_DSTATE = Intergration_TJA_B.Max;

  /* Update for Delay: '<S313>/Delay1' */
  Intergration_TJA_DW.icLoad_c = 0U;
  Intergration_TJA_DW.Delay1_DSTATE = Intergration_TJA_B.Max1_j;

  /* Update for Delay: '<S314>/Delay1' */
  Intergration_TJA_DW.icLoad_g = 0U;
  Intergration_TJA_DW.Delay1_DSTATE_n = Intergration_TJA_B.Max1;

  /* Update for Memory: '<S16>/Memory1' */
  Intergration_TJA_DW.Memory1_PreviousInput = Intergration_TJA_B.Switch_h;

  /* Update for Memory: '<S16>/Memory2' incorporates:
   *  Outport: '<Root>/ACC_LgtCtrl_st'
   */
  Intergration_TJA_DW.Memory2_PreviousInput = Intergration_TJA_Y.ACC_LgtCtrl_st;

  /* Update for Delay: '<S16>/Delay' */
  Intergration_TJA_DW.Delay_DSTATE_f = Intergration_TJA_B.LCK_Mode;

  /* Update for Memory: '<Root>/Memory' incorporates:
   *  Outport: '<Root>/VLC_LgtCmd_st'
   */
  Intergration_TJA_DW.Memory_PreviousInput_c = Intergration_TJA_Y.VLC_LgtCmd_st;

  /* Update for ModelReference: '<Root>/ACC' incorporates:
   *  Inport: '<Root>/DrvAct'
   *  Inport: '<Root>/ObjList'
   *  Outport: '<Root>/ACC_LgtCtrl_st'
   */
  AccTarSel_Update(&Intergration_TJA_B.ATS_Po_st);

  /* Update for ModelReference: '<Root>/VLC' incorporates:
   *  Outport: '<Root>/ACC_LgtCtrl_st'
   *  Outport: '<Root>/VLC_LgtCmd_st'
   */
  VLC_Update();

  /* Update for ModelReference: '<Root>/Model' */
  LCK_Update();

  /* Update for Chart: '<Root>/OutputSignal_OS' */

  /* Update for S-Function (RTICANMM_SETUP_Controller1): '<S12>/sfcn' */
  /* Level2 S-Function Block: '<S12>/sfcn' (RTICANMM_SETUP_Controller1) */
  {
    SimStruct *rts = Intergration_TJA_M->childSfunctions[2];
    sfcnUpdate(rts,0);
    if (ssGetErrorStatus(rts) != (NULL))
      return;
  }

  /* Update absolute time for base rate */
  /* The "clockTick0" counts the number of times the code of this task has
   * been executed. The absolute time is the multiplication of "clockTick0"
   * and "Timing.stepSize0". Size of "clockTick0" ensures timer will not
   * overflow during the application lifespan selected.
   * Timer of this task consists of two 32 bit unsigned integers.
   * The two integers represent the low bits Timing.clockTick0 and the high bits
   * Timing.clockTickH0. When the low bit overflows to 0, the high bits increment.
   */
  if (!(++Intergration_TJA_M->Timing.clockTick0)) {
    ++Intergration_TJA_M->Timing.clockTickH0;
  }

  Intergration_TJA_M->Timing.t[0] = Intergration_TJA_M->Timing.clockTick0 *
    Intergration_TJA_M->Timing.stepSize0 +
    Intergration_TJA_M->Timing.clockTickH0 *
    Intergration_TJA_M->Timing.stepSize0 * 4294967296.0;
}

